<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDn0ttMK5OWmjgNTAxqUDX8uAaE_ZC61VU"></script>
<script>

    var map, line = 0, lines = [], playing = false, marker;

    (function($){
        map_initialize();
        do_reset();
        $('.reset').on('click', function(e) {
            do_reset();
            e.preventDefault();
        });
        $('.startstop').on('click', function(e) {
            if (playing === false) {
                playing = true;
                $(this).addClass('playing').text('Pause');
                do_move();
            } else {
                playing = false;
                $(this).removeClass('playing').text('Start');
            }
            e.preventDefault();
        });
        $('.zoomin').on('click', function(e) {
            map.setZoom(map.getZoom() + 1);
            e.preventDefault();
        });
        $('.zoomout').on('click', function(e) {
            map.setZoom(map.getZoom() - 1);
            e.preventDefault();
        });

        $('.maptype').on('change', function(e) {
            var mapType = $(this).val();
    console.log(mapType);
            map.setMapTypeId(google.maps.MapTypeId[mapType]);
        });
        $('.data').on('change', function(e) {
            do_reset();
        });


    })(jQuery);

    function do_reset() {
        line = 0;
        lines = $('.data').val().split('\n');
        playing = false;
        do_move();
        $(this).removeClass('playing').text('Start');
    }

    function do_focus() {
        if (typeof marker !== "undefined") {
            map.setCenter(marker.getPosition());
        }
    }

    function do_move() {

        // get line
        var l = lines[line].split(/[\t\s]+/);
        var lat = parseFloat(l[0]);
        var lon = parseFloat(l[1]);

        if (isNaN(lat) || isNaN(lon)) {
            line++;
            do_move();
            return;
        }

        var pos = new google.maps.LatLng(lat, lon);

        if (typeof marker !== "undefined") {
            marker.setPosition(pos);
        } else {
            marker = new google.maps.Marker({
                position: pos,
                map: map
            });
        }

        if ($('.focus').is(':checked')) do_focus();

        console.log(line+': '+lat+' - '+lon);

        line++;

        if (playing === true) {
            var interval = $('.speed').val();
            setTimeout('do_move()', interval);
        }
    }

    function map_initialize() {


        var mapOptions = {
            mapTypeId: 'hybrid',
            maxZoom: 23,
            streetViewControl: false,
            disableDefaultUI: true
        };

        map = new google.maps.Map(document.getElementById("map_canvas"), mapOptions);

        map.setCenter({lat: 52.8, lng: -0.7});
        map.setZoom(17);



        // refresh_markers();


        // setInterval('refresh_markers()', refresh * 1000);
        // setInterval('follow_markers()', 100);


    }



</script>
